    [],nt"num_tags": 6,nt"name": "des-lacs-national-wildlife-refuge-annual-narrative-report-calendar-year-2001",nt"isopen":
    false,nt"url": null,nt"notes": "This annual narrative report for Des Lacs
    National Wildlife Refuge summarizes Refuge activities during the 2001 calendar year.
    The report begins with a summary of the year's highlights and weather conditions.
    The report includes a planning section which discusses management planning, compliance
    with environmental and cultural resource mandates, and research and investigations.
    Refuge administration is outlined; information about personnel, youth programs,
    other manpower programs, volunteer programs, funding, safety, and technical assistance
    is given. Habitat management is also covered; subjects include wetlands, croplands,
    grasslands, grazing, forests, haying, fire management, pest control, and water rights.
    The wildlife section of the report discusses wildlife diversity, endangered and
    threatened species, waterfowl, marsh birds and waterbirds, shorebirds, raptors,
    other migratory birds, game mammals, other resident wildlife, animal control, marking
    and banding, and disease prevention and control. The public uses of the Refuge described
    in this report include outdoor classrooms, interpretive programs, hunting, trapping,
    and wildlife observation. The equipment and facilities section of the report provides
    information about new construction, rehabilitation, major maintenance, equipment
    utilization and replacement, and computer systems. Cooperative programs and items
    of interest are provided at the end. Photographs are attached.",nt"owner_org":
